import React, { useState } from 'react';
import './App.css';

export const App = () => {
  const init = 0;
  const [state, setState] = useState(init);

  const plus = () => {
    setState(state + 1)
  }
  return (
    <div className="App">
      <header className="App-header">
        <input>{state}</input>
        <button onClick={plus}>+1</button>
      </header>
    </div>
  );
}
